import "./App.scss";
import Header from "./components/Header";
import TableXuatXu from "./components/TableXuatXu";
import Container from "react-bootstrap/Container";
import ModelAddNew from "./components/ModalsAddNew";
import { useState } from "react";
import { Routes, Route, Link } from "react-router-dom";
import Home from "./components/Home";

function App() {
  const [isShowModalAddNew, setIsShowModalAddNew] = useState(false);
  const handleClose = () => {
    setIsShowModalAddNew(false);
  };
  return (
    <div className="app-container">
      <Header />
      <Container>
        <div className="my-3 add-new">
          <samp>List Xuat Xu</samp>
          <button
            className="btn btn-success"
            onClick={() => setIsShowModalAddNew(true)}
          >
            Them
          </button>
        </div>
        <div className="my-3">
          <Routes>
            <Route path="/home" element={<Home />} />
            <Route path="/table-xuatXu" element={<TableXuatXu />} />
          </Routes>
        </div>
      </Container>
      <ModelAddNew show={isShowModalAddNew} handleClose={handleClose} />
    </div>
  );
}

export default App;
